window.bookSummaryJSON = "<p><b>From #1 </b><b><i>New York Times</i></b><b> bestselling author Lisa Gardner, a chilling thriller about a young man gone missing in the wilderness of Wyoming...and the secrets uncovered by the desperate effort to find him</b></p> <p>Timothy O’Day knew the woods. Yet when he disappeared on the first night of a bachelor party camping trip with his best friends in the world, he didn’t leave a trace. What he did leave behind were two heartbroken parents, a crew of guilt-ridden groomsmen, and a pile of clues that don’t add up. </p> <p>Frankie Elkin doesn’t know the woods, but she knows how to find people. So when she reads that Timothy’s father is organizing one last search, she heads to Wyoming. Despite the rescue team’s reluctance, she joins them. But as they hike into the mountains, it becomes clear that there’s something dangerous at work in the woods...or someone who is willing to do anything to stop them from going any further. </p> <p>Running out of time and up against the worst man and nature have to offer, Frankie and the search party will discover what evil awaits those who go one step too far...</p>"; 
